    false,nt"url": null,nt"notes": "This is an environmental assessment that
    discussed and analyzes the proposed restoration of historical nesting populations
    of Common and Roseate terns on Two Bush Island, a unit of Franklin Island National
    Wildlife Refuge, and Little Two Bush Island, owned by Maine Department of Inland
    Fish and Wildlife. In order to achieve this goal, this report proposes the use of
    tern decoys and tern vocalization broadcasts, preceded by gull removal using 1339
    Gull Toxicant, a registered avicide.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
